import React from 'react';
import './DotsToggle.css';

const DotsToggle = props => {
    return (
        <button className="toggle-btn" onClick={this.props.click}>
            <div className="toggle-btn-line" />
            <div className="toggle-btn-line" />
            <div className="toggle-btn-line" />
        </button>
    )
}

export default DotsToggle
